function updateFocusDuration({ focusDuration, setFocusDuration, addSub }) {
  switch (focusDuration) {
    case focusDuration < 60 && addSub === "add":
      setFocusDuration(focusDuration + 5);
      break;
    case 5 < focusDuration && addSub === "sub":
    default:
      setFocusDuration(focusDuration - 5);
  }
}
